import React from 'react'


class Corps extends React.Component {
    
    render() { 
        return (
            <div className="bgCorps ">
                <div className="row">
                    <div className="col-6">
                        <img className="tailleImg " src={img1} alt="" />
                    </div>
                    <div className="col-6">
                        <img className="tailleImg" src="../img/icon-paper.svg" alt="" />

                    </div>
                </div>
                <div className="text-center">
                        <img className="tailleImg" src="../img/icon-rock.svg" alt="" />

                </div>
            </div>
            
        );
    }
}

export default Corps;
